			end
			WhileCount = WhileCount + 1
		end
	end
end

function CreatePlayers(min_x, max_x, min_y, max_y, mixed_civilizations, town_halls, symmetric)
	-- create player units
	local symmetric_starting_location = {0, 0}
	for i=0,14 do
		if (Map.Info.PlayerType[i] == PlayerPerson or Map.Info.PlayerType[i] == PlayerComputer) then
			local possible_civilizations = {}
			if ((wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp" or mixed_civilizations) and table.getn(GetCivilizationAvailableFactions("dwarf")) > 0) then
				table.insert(possible_civilizations, "dwarf")
			end
			if ((wyrmsun.tileset == "conifer_forest_summer" or wyrmsun.tileset == "conifer_forest_autumn" or wyrmsun.tileset == "fairlimbed_forest" or mixed_civilizations) and table.getn(GetCivilizationAvailableFactions("germanic")) > 0 and (TechLevel[i + 1] == "" or TechLevel[i + 1] == "Agrarian (Bronze)" or TechLevel[i + 1] == "Civilized (Bronze)")) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "germanic")
			end
			if ((wyrmsun.tileset == "conifer_forest_summer" or wyrmsun.tileset == "conifer_forest_autumn" or wyrmsun.tileset == "fairlimbed_forest" or mixed_civilizations) and table.getn(GetCivilizationAvailableFactions("teuton")) > 0 and (TechLevel[i + 1] == "Agrarian (Iron)" or TechLevel[i + 1] == "Civilized (Iron)")) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "teuton")
			end
			if (GetPlayerData(i, "AiEnabled") and (wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp" or wyrmsun.tileset == "fairlimbed_forest" or mixed_civilizations) and table.getn(GetCivilizationAvailableFactions("gnome")) > 0) then -- allow gnomes in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "gnome")
			end
			if (GetPlayerData(i, "AiEnabled") and (wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp" or mixed_civilizations) and table.getn(GetCivilizationAvailableFactions("goblin")) > 0) then
				table.insert(possible_civilizations, "goblin")
			end
			if (table.getn(possible_civilizations) < 1) then
				Map.Info.PlayerType[i] = PlayerNobody
			else
				local WhileCount = 0
				local player_spawn_point
				local starting_point_found = false
				while (starting_point_found == false and WhileCount < 1000) do
					if (symmetric == false) then
						player_spawn_point = {SyncRand(max_x - min_x + 1) + min_x, SyncRand(max_y - min_y + 1) + min_y}
					else
						if (i == 0 or i == 4 or i == 8 or i == 12) then
							player_spawn_point = {SyncRand((max_x / 2) - min_x) + min_x, SyncRand((max_y / 2) - min_y) + min_y}
							symmetric_starting_location = player_spawn_point
						elseif (i == 1 or i == 5 or i == 9 or i == 13) then
							player_spawn_point = {math.abs(symmetric_starting_location[1] - (Map.Info.MapWidth - 1)) - 3, symmetric_starting_location[2]}
						elseif (i == 2 or i == 6 or i == 10 or i == 14) then
							player_spawn_point = {symmetric_starting_location[1], math.abs(symmetric_starting_location[2] - (Map.Info.MapHeight - 1)) - 3}
						elseif (i == 3 or i == 7 or i == 11) then
							player_spawn_point = {math.abs(symmetric_starting_location[1] - (Map.Info.MapWidth - 1)) - 3, math.abs(symmetric_starting_location[2] - (Map.Info.MapHeight - 1)) - 3}
						end
					end
					starting_point_found = true
					if ((player_spawn_point[1] + 4) > Map.Info.MapWidth or (player_spawn_point[2] + 4) > Map.Info.MapHeight or (player_spawn_point[1] - 1) < 0 or (player_spawn_point[2] - 1) < 0) then
						starting_point_found = false
					end
					for j=0,14 do
						if (j < i and (Map.Info.PlayerType[j] == PlayerPerson or Map.Info.PlayerType[j] == PlayerComputer)) then
							if (math.abs(player_spawn_point[1] - Players[j].StartPos.x) < 32 and math.abs(player_spawn_point[2] - Players[j].StartPos.y) < 32) then
								starting_point_found = false
							end
						end
					end
					WhileCount = WhileCount + 1
				end
				
				SetStartView(i, player_spawn_point[1], player_spawn_point[2])

				SetPlayerData(i, "RaceName", possible_civilizations[SyncRand(table.getn(possible_civilizations)) + 1])
				for sub_x=-1,4 do
					for sub_y=-1,4 do
						SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Road")
					end
				end
				if (town_halls) then
					for sub_x=0,3 do
						for sub_y=0,3 do
							SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Town Hall " .. i)
						end
					end
				end
				CreateStartingGoldMine(i) -- create the player's gold mine

				SetPlayerData(i, "Resources", "gold", 10000)
				SetPlayerData(i, "Resources", "lumber", 3000)
				SetPlayerData(i, "Resources", "stone", 1000)
				SetPlayerData(i, "Resources", "oil", 1000)
				SetAiType(i, "land-attack")
			end
		end
	end

	SetPlayerData(15, "RaceName", "neutral")
end

function SetMapBorders(tile_type, replace_tile)

	for x=0,(Map.Info.MapWidth - 1) do
		if (RawTile(x, 0) == "" or replace_tile == true) then
			SetRawTile(x, 0, tile_type)
		end
		if (RawTile(x, 1) == "" or replace_tile == true) then
			SetRawTile(x, 1, tile_type)
		end

		if (RawTile(x, Map.Info.MapHeight - 2) == "" or replace_tile == true) then
			SetRawTile(x, Map.Info.MapHeight - 2, tile_type)
		end
		if (RawTile(x, Map.Info.MapHeight - 1) == "" or replace_tile == true) then
			SetRawTile(x, Map.Info.MapHeight - 1, tile_type)
		end
	end
	for y=0,(Map.Info.MapHeight - 1) do
		if (RawTile(0, y) == "" or replace_tile == true) then
			SetRawTile(0, y, tile_type)
		end
		if (RawTile(1, y) == "" or replace_tile == true) then
			SetRawTile(1, y, tile_type)
		end

		if (RawTile(Map.Info.MapWidth - 2, y) == "" or replace_tile == true) then
			SetRawTile(Map.Info.MapWidth - 2, y, tile_type)
		end
		if (RawTile(Map.Info.MapWidth - 1, y) == "" or replace_tile == true) then
			SetRawTile(Map.Info.MapWidth - 1, y, tile_type)
		end
	end
end

