						elseif (RandomNumber >= 90) then
							unit = OldCreateUnit("unit-wyrm", 2, {RandomX, RandomY})
							Count = Count - 1
						end
					end
				end
			end
			WhileCount = WhileCount + 1
		end
		
		if (passive_dungeon_player_name ~= "") then
